import React from 'react'
import { Link } from 'react-router-dom'
import HomeIcon from '@material-ui/icons/Home';
import HistoryIcon from '@material-ui/icons/History';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
export function Toolbar({ setFavoritesList }) {
    return (
        <div className="modal-bar">
            <Link className="flex align-center" to="/"><HomeIcon />Home page</Link>
            <Link className="flex align-center" to=""><VideoLibraryIcon />Library</Link>
            <Link className="flex align-center" to=""><HistoryIcon />History</Link>
            <Link className="flex align-center" to="/favorites"><StarBorderIcon />Videos I liked</Link>
            <Link className="flex align-center" to="/play"><PlayArrowIcon />Last video play</Link>
        </div>
    )
}
